```json
{
  "application": "LDSC",
  "details": {
    "software": [
      "anaconda",
      "ldsc"
    ],
    "resources": {
      "partition": "defq",
      "memory": "60G",
      "time": "2:0:0",
      "input_files": [
        "/data/abattle4/prashanthi/recount3_paper/data/s_LDSC/UKBB/"$TRAIT".imputed_v3.ldsc.both_sexes.tsv.gz",
        "/data/abattle4/prashanthi/recount3_paper/data/s_LDSC/1000G_Phase3_weights_hm3_no_MHC/weights.hm3_noMHC.",
        "/data/abattle4/prashanthi/recount3_paper/data/s_LDSC/all-genes/SAMGENIC.,",
        "/data/abattle4/prashanthi/recount3_paper/data/s_LDSC/1000G_Phase3_frq/1000G.EUR.QC."
      ],
      "output_file": "/data/abattle4/prashanthi/recount3_paper/results/s_LDSC/"$STUDY"/"$CENTRALITY"/results/UKBB/"$TRAIT"_all_genes"
    },
    "script": "/data/abattle4/prashanthi/recount3_paper/src/08_stratified_LDSC/ldsc.py"
  }
}
```

This script runs the LDSC software, which is used for estimating the genetic correlation between traits. The script uses resources from the "defq" partition, requiring 60GB of memory and a maximum runtime of 2 hours. It utilizes the anaconda environment to manage dependencies and uses several input files, including a trait file, LD weights, reference LD scores, and frequency files. The output file contains the results of the LDSC analysis.
